import React from "react";
import "./index.css"
// reactstrap components
import {
  NavItem,
  NavLink,
  Nav,
  TabContent,
  TabPane,
  Col
} from "reactstrap";

function LeftSideBar(){
  const [iconHTabs,setIconHTabs] = React.useState("1");
  return (
    <>
    <Col md="5">
      <Nav className="nav-pills-info nav-pills-icons" pills role="tablist">
        <NavItem>
          <NavLink
            className={iconHTabs === "1" ? "active" : ""}
            href="#pablo"
            onClick={e => {
              e.preventDefault();
              setIconHTabs("1");
            }}
          >
            <i className="now-ui-icons objects_umbrella-13"></i>
            Home
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink
            className={iconHTabs === "2" ? "active" : ""}
            href="#pablo"
            onClick={e => {
              e.preventDefault();
              setIconHTabs("2");
            }}
          >
            <i className="now-ui-icons shopping_shop"></i>
            Messages
          </NavLink>
        </NavItem>
        <NavItem>
          <NavLink
            className={iconHTabs === "3" ? "active" : ""}
            href="#pablo"
            onClick={e => {
              e.preventDefault();
              setIconHTabs("3");
            }}
          >
            <i className="now-ui-icons ui-2_settings-90"></i>
            Settings
          </NavLink>
        </NavItem>
      </Nav>
      </Col>
      <Col md="8">
      <TabContent className="tab-space" activeTab={"iconHTabs" + iconHTabs}>
        <TabPane tabId="iconHTabs1">
          Collaboratively administrate empowered markets via plug-and-play
          networks. Dynamically procrastinate B2C users after installed base
          benefits. <br></br>
          <br></br>
          Dramatically visualize customer directed convergence without
          revolutionary ROI.
        </TabPane>
        <TabPane tabId="iconHTabs2">
          Efficiently unleash cross-media information without cross-media
          value. Quickly maximize timely deliverables for real-time schemas.{" "}
          <br></br>
          <br></br>
          Dramatically maintain clicks-and-mortar solutions without functional
          solutions.
        </TabPane>
        <TabPane tabId="iconHTabs3">
          Completely synergize resource taxing relationships via premier niche
          markets. Professionally cultivate one-to-one customer service with
          robust ideas. <br></br>
          <br></br>
          Dynamically innovate resource-leveling customer service for state of
          the art customer service.
        </TabPane>
      </TabContent>
      </Col>
    </>
  );
}

export default LeftSideBar;
